import Menu from "./components/menu/menu";
import Contain from "./components/contain";

const App = (props) => {
  const news = {
    text: "hui",
    header: "hui",
  };
  return (
    <div>
      <Menu />
      <Contain news={news} />
    </div>
  );
};

export default App;
